[Form]
public class PMFSeqReqRouteChangesListPage extends FormRun implements SysIFilterEventHandler
{
    private ReqTransPlanIdFilter reqTransPlanIdFilter;
    private ReqPlanId planId;

    private const int currentVersion = 1;

    #localmacro.CurrentList
        planId
    #endmacro
}

public boolean unpack(container packedClass)
{
    int version = RunBase::getVersion(packedClass);

    switch (version)
    {
        case currentVersion:
            [version, #CurrentList] = packedClass;
            return true;
    }
    return false;
}

public void initParmDefault()
{
    // The method is needed because of the call: xSysLastValue::getLast(this);
    // since getLast assumes that the passed object implements initParmDefault method.
}

public void init()
{
    ReqParameters::checkPlanningProcessesAreEnabled();

    super();

    if (PMFSeqReqRouteChangesListPageFilterPlanFlight::instance().isEnabled())
    {
        this.initPlanIdFilter();
        reqTransPlanIdFilter = ReqTransPlanIdFilter::newStandard(formControlStr(PMFSeqReqRouteChangesListPage, PlanIdFilter), this, planId);
    }

    PlanIdFilter.visible(PMFSeqReqRouteChangesListPageFilterPlanFlight::instance().isEnabled());
}

public void initPlanIdFilter()
{
    if (planId == '') // The planIdFilter was not set by the xSysLastValue::getLast(this); call.
    {
        planId = ReqPlanSched::defaultDynamicId();
    }
}

public ReqPlanId parmPlanId(ReqPlanId _planId = planId)
{
    planId = _planId;

    return planId;
}

/// <summary>
/// If the saved view is changed, we need to adjust the PlanId and PlanVersion filters to the one selected in the view.
/// </summary>
private void updatePlanVersionRangesOnSavedViewChange()
{
    QueryBuildDataSource qbds = ReqPlanVersion_ds.queryRunQueryBuildDataSource();

    if (ReqTransPoFormRunConfigurationToggle::instance().isEnabled()
        && ReqTransPoFormRunConfigurationContext::instanceExists()
        && qbds)
    {
        var planRange = ReqTransPoFormPlanVersionFilterManager::findEnabledRange(qbds, fieldNum(ReqPlanVersion, ReqPlanId));
        ReqPlanId currentPlanId;
        if (planRange)
        {
            currentPlanId = planRange.value();
        }

        if (currentPlanId)
        {
            PlanIdFilter.text(currentPlanId);
            PlanIdFilter.modified();

            RefRecId activePlanVersionRecId = reqTransPlanIdFilter.planVersion().RecId;
            ReqTransPoFormPlanVersionFilterManager::updatePlanVersionQueryRanges(ReqPo_ds.queryRun().query(), activePlanVersionRecId);
        }
    }
}
